import React from "react";
import userImage from '../../assents/userImage.png'
export default function NewCard(props) {
  return (
    // const arr1 = ["Niyam", "Inz", "Faizail","Rohit","Shivam"]
    <div className="card">
      <img src={userImage} className="Img" />
      <h1 style={{color:"#fff"}}></h1>
      <h3 className="customer_designation" style={{color:"#fff"}}>Art Director</h3>
    
    </div>
  );
}
